create table public.taxes (
  id bigint not null,
  name character varying(255) not null,
  rates json null,
  cca3 character varying(5) null,
  cca2 character varying(3) null,
  zone character varying(255) null,
  vat_id character varying(255) null,
  tax_type character varying(255) null,
  generic_label character varying(255) null,
  country_id bigint null,
  created_at timestamp without time zone null,
  updated_at timestamp without time zone null,
  constraint taxes_pkey primary key (id),
  constraint taxes_country_id_fkey foreign key (country_id) references countries (id) on delete cascade
) tablespace pg_default;

